import React from "react";
import reactDom from 'react-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Modal } from "react-bootstrap";
import { Card } from "react-bootstrap";
import { Image } from "react-bootstrap";
import m from "./Body.module.css"
import Button from 'react-bootstrap/Button'
import { render } from "@testing-library/react";

function Example() {
    const [show, setShow] = useState(false);

    const handleClose = () => setShow(false);
    const handleShow = () => setShow(true);

    return (
        <>
            <Button variant="primary" onClick={handleShow}>
                Launch demo modal
            </Button>

            <Modal show={show} onHide={handleClose}>
                <Modal.Header closeButton>
                    <Modal.Title>Modal heading</Modal.Title>
                </Modal.Header>
                <Modal.Body>Woohoo, you're reading this text in a modal!</Modal.Body>
                <Modal.Footer>
                    <Button variant="secondary" onClick={handleClose}>
                        Close
                    </Button>
                    <Button variant="primary" onClick={handleClose}>
                        Save Changes
                    </Button>
                </Modal.Footer>
            </Modal>
        </>
    );
}

render(<Body />);


function Body() {
    return (

        <div class="container">
            <h1 class="pt-3 pb-3">Танки X уровня вселенной World of Tanks</h1>
            <div class="row">
                <div class="card mb-3 col-sm-12 col-md-6 col-lg-4 ">
                    <div class="row g-0">
                        <div class="col-4">
                            <Image style={{ height: "105px" }} src="https://avatars.mds.yandex.net/get-zen_doc/28845/pub_5e4e6120386b1c555647e3cd_5e4e634da37e4678c176a650/scale_1200" />
                        </div>
                        <div class="col-8">
                            <div class="card-body">
                                <h5 class="card-title" className={m.cardtitle}>ИС-7</h5>
                                <Button variant="secondary" className={m.butnsm} data-bs-target="#staticBackdrop">
                                    Подробнее
                                </Button>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div >


    )
}


export default Body;
